"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["9938"],{83789:function(e){e.exports=JSON.parse('{"name":"woodpecker-gitea-publisher-golang","url":"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang","icon":"https://raw.githubusercontent.com/woodpecker-kit/woodpecker-gitea-publisher-golang/main/doc/logo.svg","description":"Plugin to publish golang package to a Gitea Go Package Registry","docs":"<p>woodpecker-gitea-publisher-golang</p>\\n<p>plugin as <a href=\\"https://woodpecker-ci.org/\\">https://woodpecker-ci.org/</a> for <a href=\\"https://docs.gitea.com/usage/packages/go/\\">https://docs.gitea.com/usage/packages/go/</a> to publisher golang package</p>\\n<h2>Features</h2>\\n<ul>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> push to <a href=\\"https://docs.gitea.com/usage/packages/go/\\">gitea Go Package Registry</a></li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> use TempDir to generate go mod zip file</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> support dry-run mode</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> auto get gitea base URL by <code>CI_FORGE_URL</code></li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> support <a href=\\"https://en.wikipedia.org/wiki/Monorepo\\">Monorepo</a><ul>\\n<li>use <code>settings.gitea-publish-golang-path-go</code> to publish dir go.mod one by one</li>\\n</ul>\\n</li>\\n<li><input type=\\"checkbox\\" disabled=\\"\\" checked=\\"\\"> out publish info json file default <code>dist/go-mod-upload.json</code><ul>\\n<li>use <code>settings.gitea-publish-golang-update-result-root-path</code> to change out root path, default <code>dist</code></li>\\n<li>use <code>settings.gitea-publish-golang-update-result-file-name</code> to change out file name, default <code>go-mod-upload.json</code></li>\\n</ul>\\n</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>debug</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>open debug log or open by env <code>PLUGIN_DEBUG</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-api-key</code></td>\\n<td><strong>yes</strong></td>\\n<td></td>\\n<td>gitea api key, Required</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-base-url</code></td>\\n<td><strong>no</strong></td>\\n<td></td>\\n<td>gitea base url, default by <code>CI_FORGE_URL</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-insecure</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>gitea insecure enable</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-dry-run</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>dry run mode</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-path-go</code></td>\\n<td><strong>no</strong></td>\\n<td></td>\\n<td>publish go package is dir to find go.mod, will append project root path, default is this project root path</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-remove-paths</code></td>\\n<td><strong>no</strong></td>\\n<td><code>[\\"dist\\"]</code></td>\\n<td>publish go package remove paths, this path under <code>gitea-publish-golang-path-go</code>, default will remove <code>dist</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-update-result-root-path</code></td>\\n<td><strong>no</strong></td>\\n<td><em>dist</em></td>\\n<td>out result root path append CI Workspace, default <code>dist</code></td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-update-result-file-name</code></td>\\n<td><strong>no</strong></td>\\n<td><em>go-mod-upload.json</em></td>\\n<td>out file name, default <code>go-mod-upload.json</code></td>\\n</tr>\\n</tbody></table>\\n<p><strong>Hide Settings:</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Name</th>\\n<th>Required</th>\\n<th>Default value</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>timeout_second</code></td>\\n<td><strong>no</strong></td>\\n<td><em>10</em></td>\\n<td>command timeout setting by second</td>\\n</tr>\\n<tr>\\n<td><code>gitea-publish-golang-timeout-second</code></td>\\n<td><strong>no</strong></td>\\n<td><em>60</em></td>\\n<td>gitea release api timeout second, default 60, less 30</td>\\n</tr>\\n<tr>\\n<td><code>woodpecker-kit-steps-transfer-file-path</code></td>\\n<td><strong>no</strong></td>\\n<td><code>.woodpecker_kit.steps.transfer</code></td>\\n<td>Steps transfer file path, default by <code>wd_steps_transfer.DefaultKitStepsFileName</code></td>\\n</tr>\\n<tr>\\n<td><code>woodpecker-kit-steps-transfer-disable-out</code></td>\\n<td><strong>no</strong></td>\\n<td><em>false</em></td>\\n<td>Steps transfer write disable out</td>\\n</tr>\\n</tbody></table>\\n<h2>Example</h2>\\n<ul>\\n<li>workflow with backend <code>docker</code></li>\\n</ul>\\n<p><a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang/tags?page=1&amp;ordering=last_updated\\"><img alt=\\"docker hub version semver\\" src=\\"https://img.shields.io/docker/v/sinlov/woodpecker-gitea-publisher-golang?sort=semver\\"></a>\\n<a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang\\"><img alt=\\"docker hub image size\\" src=\\"https://img.shields.io/docker/image-size/sinlov/woodpecker-gitea-publisher-golang\\"></a>\\n<a href=\\"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang/tags?page=1&amp;ordering=last_updated\\"><img alt=\\"docker hub image pulls\\" src=\\"https://img.shields.io/docker/pulls/sinlov/woodpecker-gitea-publisher-golang\\"></a></p>\\n<pre><code class=\\"language-yml\\">labels:\\n  backend: docker\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: sinlov/woodpecker-gitea-publisher-golang:latest\\n    pull: false\\n    settings:\\n      # debug: true\\n      # gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-publish-golang-path-go: \\"\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      # gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      # gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<ul>\\n<li>workflow with backend <code>local</code>, must install at local and effective at evn <code>PATH</code><ul>\\n<li>can download by <a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/releases\\">github release</a></li>\\n</ul>\\n</li>\\n<li>install at ${GOPATH}/bin, latest</li>\\n</ul>\\n<pre><code class=\\"language-bash\\">go install -a github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/cmd/woodpecker-gitea-publisher-golang@latest\\n</code></pre>\\n<p><a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/tags\\"><img alt=\\"GitHub latest SemVer tag)\\" src=\\"https://img.shields.io/github/v/tag/woodpecker-kit/woodpecker-gitea-publisher-golang\\"></a>\\n<a href=\\"https://github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/releases\\"><img alt=\\"GitHub release)\\" src=\\"https://img.shields.io/github/v/release/woodpecker-kit/woodpecker-gitea-publisher-golang\\"></a></p>\\n<ul>\\n<li>install at ${GOPATH}/bin, v1.0.0</li>\\n</ul>\\n<pre><code class=\\"language-bash\\">go install -v github.com/woodpecker-kit/woodpecker-gitea-publisher-golang/cmd/woodpecker-gitea-publisher-golang@v1.0.0\\n</code></pre>\\n<pre><code class=\\"language-yml\\">labels:\\n  backend: local\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: woodpecker-gitea-publisher-golang\\n    settings:\\n      # debug: true\\n      # gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-publish-golang-path-go: \\"\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      # gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      # gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<ul>\\n<li>full config</li>\\n</ul>\\n<pre><code class=\\"language-yaml\\">labels:\\n  backend: docker\\nsteps:\\n  woodpecker-gitea-publisher-golang:\\n    image: sinlov/woodpecker-gitea-publisher-golang:latest\\n    pull: false\\n    settings:\\n      debug: true\\n      gitea-publish-golang-dry-run: true # dry run mode\\n      gitea-publish-golang-timeout-second: 120 # gitea release api timeout second, default 60, less 30 \\n      gitea-publish-golang-api-key: # gitea api key, Required\\n        from_secret: gitea_api_key_release\\n      gitea-publish-golang-base-url: \\"https://gitea.example.com\\" # default by CI_FORGE_URL auto to find\\n      gitea-publish-golang-insecure: true #  gitea insecure enable\\n      gitea-publish-golang-path-go: \\"sub-go\\" # publish go package is dir to find go.mod, will append project root path, default is this project root path\\n      gitea-publish-golang-remove-paths: # publish go package remove paths, this path under `gitea-publish-golang-path-go`, default will remove `dist`\\n        - \\"dist\\"\\n      gitea-publish-golang-update-result-root-path: \\"dist\\" # out result root path append CI Workspace, default `dist`\\n      gitea-publish-golang-update-result-file-name: \\"go-mod-upload.json\\" # out file name, default `go-mod-upload.json`\\n</code></pre>\\n<h2>Notes</h2>\\n<ul>\\n<li>go mod zip file will generate by TempDir and try to remove after publish</li>\\n<li>template dir path graph <code>tempDir/woodpecker-gitea-publisher-golang/{repo-hostname}/{owner}/{repo}/{build_number}</code></li>\\n</ul>\\n<h2>Known limitations</h2>\\n<ol>\\n<li>go mod zip file generate by <code>zip.CreateFromDir</code>, this method will check as <a href=\\"https://semver.org/\\">https://semver.org/</a>, so this kit use <code>CI_COMMIT_TAG</code> to generate version</li>\\n<li>open <code>gitea-publish-golang-dry-run</code> mode can pass all check, but not publish to gitea</li>\\n<li>but without event tag will use version mark as <code>latest</code>, this will not pass <code>zip.CreateFromDir</code>check, so will not publish to gitea</li>\\n</ol>\\n","tags":["Gitea","publish-golang"],"author":"sinlov","containerImage":"sinlov/woodpecker-gitea-publisher-golang","containerImageUrl":"https://hub.docker.com/r/sinlov/woodpecker-gitea-publisher-golang","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"}')}}]);